const CompetitionHeader = ({fixtures}) => {
   
    if (fixtures.length)    {
        return
    } else {
        return null
    }

    return (
        <div className = 'comp_header'>
            <span className = 'competition_logo'> comp thumbnail</span>
            <span className = 'competition_name'>competition ID - </span>
            <span className = 'league_group'>league type</span>
            <span className = 'date'>date</span>
        </div>
            
    )   
    
}

export default CompetitionHeader
